const uint32_t fin[4]={38720,26368,10368,10054};
const uint32_t freq[4] = {600, 1700, 1800, 2000};

// Initialize 4-bit DAC, called once 
// Input: none
// Output: none
void DAC_Init(void){
	int delay = 0;
	SYSCTL_RCGCGPIO_R |= 0x02;
	delay = 1;
	GPIO_PORTB_DIR_R |= 0x0F;
	GPIO_PORTB_DEN_R |= 0x0F;
}

// **************DAC_Out*********************
// output to DAC
// Input: 4-bit data, 0 to 15 
// Input=n is converted to n*3.3V/15
// Output: none
void DAC_Out(uint8_t data){
	GPIO_PORTB_DATA_R &= 0xF0;
	GPIO_PORTB_DATA_R |= data;
}

int part = 0;

void SysTick_Handler() {
		if(songIndex>=length){}
		else{
			DAC_Out(music[song][songIndex]);
			songIndex++;
		}
}

void playSong(uint8_t s){
	NVIC_ST_RELOAD_R = freq[s];
	songIndex=0;
	length=fin[s];
	song =s;
}

